function Fill_Resize_Form_Print(n,t,i){var u=n.outerWidth(),o=n.outerHeight(),s=t.innerHeight(),f=t.innerWidth(),r=f/u-.05,e=s/o-.05,h=0,c=0;i?(r=Math.min(r,e),e=r):r=1;u>f&&r!=1?h=Math.round((f-u*r)/2):r=1;c=Math.round((s-o*e)/2);n.css({left:"0px",top:"0px","-webkit-transform":"translate("+h+"px, 0px) scale("+r+")","-webkit-transform-origin":"0 0"})}